import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'

const Posts= (props) => {
    return (
        <h1>Posts</h1>
    )
}
const Profile = (props) => {
    return (
        <h1>Profile</h1>
    )
}
const LogOut = (props) => {
    return (
        <h1>Log Out</h1>
    )
}

const App = () => {
    return(
        <Router>
        <div className='app'>

            <div id='navigation'>
                <h1>Strangers Things</h1>
            <Link to="/posts">Posts</Link>
            <Link to="/profile">Profile</Link>
            <Link to="/logout">Log Out</Link>
            </div>
<h1>Hello world</h1>
<div id='main-section'>
       <Route path="/posts">
         <Posts />
         </Route>
         <Route path="/profile">
           <Profile />
         </Route>
         <Route  path="/logout">
           <LogOut />
         </Route>

      </div>
</div>
</Router>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('app')
  )
